// DeleteUniqueIndexCache 删除索引存在的缓存
func (s *SmsTemplateRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.SmsTemplate) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, s.cache.Key(CacheSmsTemplateByConditionPrefix))
	keys = append(keys, s.cache.Key(CacheSmsTemplateUnscopedByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[s.cache.Key(CacheSmsTemplateByIDPrefix, item.ID)] = struct{}{}
			KeyMap[s.cache.Key(CacheSmsTemplateUnscopedByIDPrefix, item.ID)] = struct{}{}
			KeyMap[s.cache.Key(CacheSmsTemplateBySmsChannelIDPrefix, item.SmsChannelID)] = struct{}{}
			KeyMap[s.cache.Key(CacheSmsTemplateUnscopedBySmsChannelIDPrefix, item.SmsChannelID)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := s.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
